import React from 'react'
import SignIn from './Sign-In'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'


function App(){

    return(
      <div>
        <Router>
          <Routes>
            <Route exact path="/" component={ SignIn }></Route>
          </Routes>
        </Router>
        </div>
    );


}

export default App;
